import React from "react"
import {
  BrowserRouter as Router,
  Routes,
  Route,
  NavLink,
} from "react-router-dom"
import { MDBBreadcrumb, MDBBreadcrumbItem } from "mdb-react-ui-kit"

export default function App() {
  return (
    <MDBBreadcrumb>
      <Routes>
        <Route
          path="/"
          element={<MDBBreadcrumbItem active>Home</MDBBreadcrumbItem>}
        ></Route>
        <Route
          path="/games"
          element={<MDBBreadcrumbItem active>Games</MDBBreadcrumbItem>}
        ></Route>
      </Routes>

      {/* <MDBBreadcrumbItem active>Library</MDBBreadcrumbItem> */}
    </MDBBreadcrumb>
  )
}
